import { registerThemeProperties } from "@ui5/webcomponents-base/dist/asset-registries/Themes.js";

import defaultThemeBase from "@ui5/webcomponents-theme-base/dist/generated/themes/sap_fiori_3/parameters-bundle.css.js";
import defaultTheme from "./sap_fiori_3/parameters-bundle.css.js";

registerThemeProperties("@ui5/webcomponents-theme-base", "sap_fiori_3", defaultThemeBase);
registerThemeProperties("@ui5/webcomponents-fiori", "sap_fiori_3", defaultTheme);
export default ":host(:not([hidden])){display:block;height:100%;width:100%;overflow:auto}.ui5-wiz-root{height:100%;width:100%;position:relative}.ui5-wiz-nav{position:absolute;display:flex;align-items:center;z-index:1;height:4rem;width:100%;padding:1rem;background:var(--sapObjectHeader_Background);font-size:var(--sapFontMediumSize);box-shadow:inset 0 -.125rem var(--sapObjectHeader_BorderColor);box-sizing:border-box;user-select:none;outline:none}.ui5-wiz-nav-list{display:flex;align-items:center;flex-direction:row;width:100%;margin:0;padding:0}.ui5-wiz-nav-list>*{flex-grow:1}.ui5-wiz-content{position:relative;padding:5rem 1rem 1rem 1rem;overflow:auto;height:100%;box-sizing:border-box;background:var(--sapBackgroundColor)}.ui5-wiz-content-item{display:block;box-sizing:border-box;padding-bottom:2rem}.ui5-wiz-content-item[hidden]{display:none}.ui5-wiz-content-item[stretch]{min-height:calc(100% + 2rem)}";
